import React, { Component } from 'react';

class NavBar extends Component {

    state={
        news:[
          "Make number of impulses in a turn constant. Increase the time duration represented by a turn. Reduce possibilities by sticking to what actually happened \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 2 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 3 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 4 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 5 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 6 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 7 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 8 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 9 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
          "NEWS Item 10 \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0",
        ]
    }

    shouldComponentUpdate(){
        return false;
    }

    render() {
      let NEWS = this.state.news.join('  ');
        return (
            <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
            <marquee style={{color: 'white'}}> {NEWS} </marquee>
            </nav>
        );
    }
}

export default NavBar;
